  false,\n\t\"url\": null,\n\t\"notes\": \"The AmeriCorps member, Refuge Wildlife
  Biologist, Volunteer Coordinator and Friends of Turnbull NWR will recruit and train
  volunteers in the use of GPS equipment, survey software and EDRRP protocols. 500
  acres of the refuge were systematically surveyed and mapped. Maps were provided
  to refuge pesticide applicators and 163 acres were treated resulting in control
  of invasives on 15 acres. Chemicals for control were purchased under this grant.
  Volunteers released 300 bio control agents on spotted knapweeed sites both on refuge
  and adjacent private land.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
